                  int_T i2;
                  const real_T *u0 = Diesel_csi_ConstP.SwitchCurrents_Value;
                  for (i2=0; i2 < 9; i2++) {
                    accum += *(Ds++) * u0[i2];
                  }

                  accum += *(Ds++) * Diesel_csi_B.OutputDCVoltage;
                  accum += *(Ds++) * 0.8;
                  accum += *(Ds++) * 0.8;
                  accum += *(Ds++) * 0.8;
                  accum += *(Ds++) * 0.8;
