      /* '<S54>:1:12' H = G'*G+eye(2*Nu)*3000; */
      /*  parte cuadratica del qp */
      /* '<S54>:1:14' ym = [ ones(p, 1)*PQ(1); ones(p, 1)*PQ(2) ]; */
