      /* '<S54>:1:31' hiq = HiBound(MPCout(2), 5000, 1000); */
      Hw6 = Diesel_csi_HiBound(Diesel_csi_B.Memory2[1], 5000.0, 1000.0);

      /* '<S54>:1:33' lop = LowBound(MPCout(1), -100, -10); */
      rtb_Generador1 = Diesel_csi_LowBound(Diesel_csi_B.Memory2[0], -10.0);

