      /* MATLAB Function: '<S5>/MPC_OutLogic' */
      /* parametros del MPC */
      /* MATLAB Function 'MPC_bio1/MPC_OutLogic': '<S55>:1' */
      /* '<S55>:1:4' Nu = 100; */
      /*  horizonte de control. */
